script: |
  super -f text -I q4303.spq | sort > q4303.out

inputs:
  - name: q4303.spq
    data: |
      SELECT DISTINCT + col0 + col2 AS col1 FROM tab1 (FORMAT parquet) WHERE NULL BETWEEN - + ( + col2 ) + - col0 + + 86 + + 80 * - col0 AND NULL;
  - name: tab1

outputs:
  - name: q4303.out
    data: |
